import React from 'react'
import SlideShow from "../../Layouts/SlideShow/SlideShow"
import styles from './Banner.module.scss'

const Banner = () => {

  return (
    <div className={ styles.root }>
      <SlideShow>
        { [1,2,3].map((item, key) =>
          <div key={ key }>
            { item }
          </div>
        ) }
      </SlideShow>
    </div>
  )
}

export default Banner
